import React from "react";

function Khuyen_mai() {
    return (
        <div className="Khuyen_mai">
            <img src="https://www.suzuki.com.vn/_next/image?url=https%3A%2F%2Fdoftr40680fkg.cloudfront.net%2Fall-page%2Ffeature-images%2Fdesk-banner%2FPC_1695891078956.jpg&w=2048&q=75" alt="hình banner khuyến mãi"/>
        </div>
    )
};
